import { React, useState } from 'react';
import "./app.css";

export default function HookTest() {
    const [count, setCount] = useState(0);
    const [isRed, setRed] = useState(false);
    if (count >= 10) {
        <style>
            #test {{
                color: "blue"
            }}
        </style>
    }
    // const [isDefualt, setUpdate] = useState(false);
    const handelIncrement = () => {
        setCount(count + 1);
        setRed(true);
    };

    return (
    <>
        <button onClick={handelIncrement}>
            Increment
        </button>
        <span id='test' className={isRed ? "red" : ""}>{count}</span>
    </>
    )
}
